import React from 'react';
import './App.css';
import Header from './Components/Header/Header.jsx';
import Navbar from './Components/NA/Header.jsx'

const App = () => {
  return (
    <div className='app-wrapper'>
      <Header/>
      <Navbar/>
      <div className='content'>
        <div>
          <img src='https://wallpapers.com/images/hd/pink-and-blue-computer-lock-screen-s4hib3inr51z1gmy.jpg'></img>
        </div>
        <div>
          POst + DEsc
        </div>
        <div>
          My posts
          <div>
            New Post
          </div>
        </div>      
      </div>
    </div>
  );
}

export default App;
